        /// <summary>
        /// Convert comma separated string lists to class objects (planet, atmos, star, volc)
        /// </summary>
        private OrganicVariant ( string genus,
                                 string species,
                                 string variant,
                                 string planetClass,
                                 decimal minG,
                                 decimal maxG,
                                 decimal minK,
                                 decimal maxK,
                                 string atmosphereClass,
                                 string starClass,
                                 string volcanism ) : base( variant, variant )
        {
            this.variant = variant;

            //this.entryid = entryid;
            this.genus = genus;
            this.species = species;

            if ( planetClass != "" )
            {
                this.planetClass = planetClass.Split( ';' ).ToList();
            }
            else
            {
                this.planetClass = new List<string> ();
            }

            this.minG = minG;
            this.maxG = maxG;
            this.minK = minK;
            this.maxK = maxK;

            if ( atmosphereClass != "" )
            {
                this.atmosphereClass = atmosphereClass.Split( ';' ).ToList();
            }
            else
            {
                this.atmosphereClass = new List<string>();
            }

            if ( starClass != "" )
            {
                this.starClass = starClass.Split( ';' ).ToList();
            }
            else
            {
                this.starClass = new List<string>();
            }

            if ( volcanism != "" )
            {
                this.volcanism = volcanism.Split( ';' ).ToList();
            }
            else
            {
                this.volcanism = new List<string>();
            }
        }

        private OrganicVariant ( string genus,
                                 string species,
                                 string variant,
                                 List<string> planetClass,
                                 decimal minG,
                                 decimal maxG,
                                 decimal minK,
                                 decimal maxK,
                                 List<string> atmosphereClass,
                                 List<string> starClass,
                                 List<string> volcanism ) : base( variant, variant )
        {
            //this.entryid = entryid;
            this.genus = genus;
            this.species = species;

            this.planetClass = planetClass;

            this.minG = minG;
            this.maxG = maxG;
            this.minK = minK;
            this.maxK = maxK;

            this.atmosphereClass = atmosphereClass;
            this.starClass = starClass;
            this.volcanism = volcanism;
        }

        /// <summary>
        /// Try getting data from the entryid first, then use variant name as a fallback
        /// </summary>
        public static OrganicVariant Lookup ( long? entryId, string variant )
        {
            OrganicVariant item;
            item = LookupByEntryId( entryId );
            if ( item == null )
            {
                item = LookupByVariant( variant );
            }

            if ( item == null )
            {
                item = new OrganicVariant();
            }

            return item;
        }

        /// <summary>
        /// Preferred method of lookup
        /// </summary>
        public static OrganicVariant LookupByEntryId ( long? entryId )
        {
            //OrganicVariant item = new OrganicVariant();
            if ( entryId != null )
            {
                if ( ENTRYID.ContainsKey( (long)entryId ) )
                {
                    return ENTRYID[ (long)entryId ];
                }
            }
            return null;
        }

        /// <summary>
        /// Populate objects with codex/extra information from the variant name.
        /// </summary>
        public static OrganicVariant LookupByVariant ( string variant )
        {
            if ( variant != "" )
            {
                if ( VARIANTS.ContainsKey( variant ) )
                {
                    long entryid = VARIANTS[ variant ];

                    return LookupByEntryId(entryid );
                }
            }
            return null;
        }
    }
